import { NaverMapsProvider } from "react-naver-maps";
import MiniMap from "./MiniMap";
import Map from "./Map";

function MapProvider(type) {
  return (
    <NaverMapsProvider
      ncpClientId="2i0nphd7yt"
      // or finClientId, govClientId
    >
      {type === "main" && <Map />}
      {type === "mini" && <MiniMap />}
    </NaverMapsProvider>
  );
}

export default MapProvider;
